func TestParser(t *testing.T) {
	for id, tc := range testCases {
		t.Run(tc.name, func(t *testing.T) {
			f, err := os.Open(FixturesDirectory + "/" + tc.filename)
			if err != nil {
				panic(err)
			}
			defer func() {
				if err = f.Close(); err != nil {
					t.Fatal(err)
				}
			}()

			scanner := bufio.NewScanner(f)
			got := PlaylistParser(scanner, id, tc.filename)

			if got.KeyURL != tc.expectedKeyURL {
				t.Errorf("Got keyURL %s, expected %s", got.KeyURL, tc.expectedKeyURL)
			}

			if got.HasMultipleViews != tc.expectedHasMultipleViews {
				t.Errorf("Got hasMultipleViews %t, expected %t", got.HasMultipleViews, tc.expectedHasMultipleViews)
			}

			if len(got.FirstViewURLs) != len(tc.expectedFirstViewURLs) {
				t.Errorf("Got firstViewURLs %d, expected %d", len(got.FirstViewURLs), len(tc.expectedFirstViewURLs))
			}

			if len(got.SecondViewURLs) != len(tc.expectedSecondViewURLs) {
				t.Errorf("Got secondViewURLs %d, expected %d", len(got.SecondViewURLs), len(tc.expectedSecondViewURLs))
			}
		})
	}
}

func BenchmarkParser(b *testing.B) {
	for id, tc := range testCases {
		b.Run(tc.name, func(b *testing.B) {
			f, err := os.Open(FixturesDirectory + "/" + tc.filename)
			if err != nil {
				b.Fatal(err)
			}
			defer func() {
				if err = f.Close(); err != nil {
					b.Fatal(err)
				}
			}()
			scanner := bufio.NewScanner(f)
			b.StartTimer()
			_ = PlaylistParser(scanner, id, tc.filename)
			b.StopTimer()
		})
	}
}
